import React from 'react';
import './Home.css';
import Header from './Header.js';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';

class Home extends React.Component {
  goAbout = () => {
    this.props.history.push("/about");
  }
  goElectry = () => {
    this.props.history.push("/electry");
  }
  goSportsHats = () => {
    this.props.history.push("/sports-hats");
  }
  goChongQingHouse = () => {
    this.props.history.push("/chongqing-house");
  }
  goGooey = () => {
    this.props.history.push("/gooey");
  }
  render() {
    return (
      <div class="home">
        <Header goToHome={this.goToHome} goToAbout={this.goToAbout}/>
        <div class="intro">
        <Container fluid={true}>
          <Row noGutters={true}>
            <Col>
              <div>
                <img src="https://i.ibb.co/BNXhKdX/Continuous-one-line-drawing-of-abstract-girl-face-Beauty-women-sketch-hand-drawn-vector-illustration.jpg"/>
              </div>
            </Col>
            <Col>
              <div class="hello">Hello! I'm YJ</div>
              <div class="desc">I am an aspiring software engineer passionate about the intersection of business and technology</div>
              <div class="desc">Graduating Brown University with a degree in Computer Science and Economics</div>
            </Col>
          </Row>
        </Container>


        </div>
      </div>
    );
  }
}

export default Home;
